import React from 'react';
import { MultiStageFormData, EcommercePayments } from '../../types/FormTypes';

interface Props {
  formData: MultiStageFormData;
  updateFormData: <K extends keyof MultiStageFormData>(
    section: K,
    data: Partial<MultiStageFormData[K]>
  ) => void;
  nextPage: () => void;
  previousPage: () => void;
  skipPage: () => void;
}

export default function EcommercePaymentsPage({ formData, updateFormData, skipPage }: Props) {
  const data = formData.ecommercePayments;

  const handleInputChange = (field: keyof EcommercePayments, value: string | string[]) => {
    updateFormData('ecommercePayments', { [field]: value });
  };

  const handleCheckboxChange = (field: keyof EcommercePayments, value: string, checked: boolean) => {
    const currentValues = (data[field] as string[]) || [];
    if (checked) {
      handleInputChange(field, [...currentValues, value]);
    } else {
      handleInputChange(field, currentValues.filter(v => v !== value));
    }
  };

  const ecommerceProviders = [
    'Shopify',
    'WooCommerce', 
    'BigCommerce',
    'Wix eCommerce',
    'Squarespace Commerce'
  ];

  const paymentProviders = [
    'Stripe',
    'Paddle',
    'PayPal',
    'Lemon Squeezy',
    'Braintree',
    'Adyen'
  ];

  const paymentPlans = [
    'One-Time Sales (e.g., goods, services, digital products)',
    'Usage-Based (e.g., API credits, metered services)',
    'Subscriptions/Memberships (e.g., monthly, annual access)'
  ];

  const accountingPlatforms = [
    'Bench',
    'FreeAgent',
    'FreshBooks',
    'GoDaddy Bookkeeping',
    'Kashoo',
    'QuickBooks',
    'Sage',
    'Wave',
    'Xero',
    'Zoho Books'
  ];

  const pricingTiers = [
    'Free Tier',
    'Starter',
    'Professional',
    'Enterprise'
  ];

  const pricingModels = [
    {
      name: 'Budget-Friendly',
      levels: ['$0.99', '$2.99', '$4.99', '$9.99'],
      description: 'Perfect for hobby projects and small apps'
    },
    {
      name: 'Standard',
      levels: ['$4.99', '$9.99', '$19.99', '$29.99'],
      description: 'Most common pricing for consumer apps'
    },
    {
      name: 'Premium',
      levels: ['$9.99', '$19.99', '$39.99', '$79.99'],
      description: 'Professional tools and business apps'
    },
    {
      name: 'Enterprise',
      levels: ['$19.99', '$49.99', '$99.99', '$199.99'],
      description: 'High-value business and enterprise solutions'
    }
  ];

  const yearlyDiscounts = [
    '5%',
    '10%',
    '15%',
    '20%',
    '25%',
    '33%',
    '50%'
  ];

  const pricingLevelNames = {
    low: ['Hobby', 'Basic', 'Starter', 'Free', 'Lite', 'Mini'],
    mid: ['Standard', 'Pro', 'Plus', 'Premium', 'Advanced', 'Business'],
    high: ['Enterprise', 'Ultimate', 'Max', 'Professional', 'Elite', 'Platinum']
  };

  return (
    <div className="space-y-8">
      <div className="text-center">
        <h2 className="text-2xl font-bold text-gray-900 mb-2">Payments & Accounting</h2>
        <p className="text-gray-600">Choose your preferred e-commerce and payment solutions</p>
      </div>

      {/* Yellow info box with Save & Skip button */}
      <div className="bg-yellow-50 border border-yellow-200 rounded-lg p-4 flex flex-col md:flex-row md:items-center md:justify-between">
        <span className="text-yellow-700 text-sm mb-2 md:mb-0">If this section does not apply,.. skip it.</span>
        <button
          onClick={skipPage}
          className="px-4 py-2 bg-orange-500 text-white rounded-md hover:bg-orange-600 transition-colors w-full md:w-auto"
        >
          Save & Skip
        </button>
      </div>

      {/* E-Commerce Providers */}
      <div className="bg-white p-6 rounded-lg border">
        <h3 className="text-lg font-semibold mb-4">E-Commerce Providers</h3>
        <p className="text-gray-600 mb-4">Select all e-commerce platforms you&apos;re comfortable with:</p>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-3">
          <label className="flex items-center space-x-3 cursor-pointer">
            <input
              type="checkbox"
              checked={(data.ecommerceProviders || []).includes('Let the AI decide these for me')}
              onChange={(e) => handleCheckboxChange('ecommerceProviders', 'Let the AI decide these for me', e.target.checked)}
              className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
            />
            <span className="text-gray-700 font-medium">Let the AI decide these for me</span>
          </label>
          <label className="flex items-center space-x-3 cursor-pointer">
            <input
              type="checkbox"
              checked={(data.ecommerceProviders || []).length === ecommerceProviders.length}
              onChange={(e) => {
                if (e.target.checked) {
                  updateFormData('ecommercePayments', { ecommerceProviders: [...ecommerceProviders] });
                } else {
                  updateFormData('ecommercePayments', { ecommerceProviders: [] });
                }
              }}
              className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
            />
            <span className="text-gray-700 font-medium">All are OK</span>
          </label>
          {ecommerceProviders.map((provider) => (
            <label key={provider} className="flex items-center space-x-3 cursor-pointer">
              <input
                type="checkbox"
                checked={(data.ecommerceProviders || []).includes(provider)}
                onChange={(e) => handleCheckboxChange('ecommerceProviders', provider, e.target.checked)}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700 text-sm">{provider}</span>
            </label>
          ))}
        </div>
      </div>

      {/* Payment Providers */}
      <div className="bg-white p-6 rounded-lg border">
        <h3 className="text-lg font-semibold mb-4">Payment Providers</h3>
        <p className="text-gray-600 mb-4">Select all payment processors you&apos;re comfortable with:</p>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-3">
          <label className="flex items-center space-x-3 cursor-pointer">
            <input
              type="checkbox"
              checked={(data.paymentProviders || []).includes('Let the AI decide these for me')}
              onChange={(e) => handleCheckboxChange('paymentProviders', 'Let the AI decide these for me', e.target.checked)}
              className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
            />
            <span className="text-gray-700 font-medium">Let the AI decide these for me</span>
          </label>
          <label className="flex items-center space-x-3 cursor-pointer">
            <input
              type="checkbox"
              checked={(data.paymentProviders || []).length === paymentProviders.length}
              onChange={(e) => {
                if (e.target.checked) {
                  updateFormData('ecommercePayments', { paymentProviders: [...paymentProviders] });
                } else {
                  updateFormData('ecommercePayments', { paymentProviders: [] });
                }
              }}
              className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
            />
            <span className="text-gray-700 font-medium">All are OK</span>
          </label>
          {paymentProviders.map((provider) => (
            <label key={provider} className="flex items-center space-x-3 cursor-pointer">
              <input
                type="checkbox"
                checked={(data.paymentProviders || []).includes(provider)}
                onChange={(e) => handleCheckboxChange('paymentProviders', provider, e.target.checked)}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700 text-sm">{provider}</span>
            </label>
          ))}
        </div>
      </div>

      {/* Payment Plans */}
      <div className="bg-white p-6 rounded-lg border">
        <h3 className="text-lg font-semibold mb-4">Payment Plans</h3>
        <p className="text-gray-600 mb-4">Select all payment models you plan to use:</p>

        <div className="space-y-3">
          <label className="flex items-center space-x-3 cursor-pointer">
            <input
              type="checkbox"
              checked={(data.paymentPlans || []).includes('Let the AI decide these for me')}
              onChange={(e) => handleCheckboxChange('paymentPlans', 'Let the AI decide these for me', e.target.checked)}
              className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
            />
            <span className="text-gray-700 font-medium">Let the AI decide these for me</span>
          </label>
          {paymentPlans.map((plan) => (
            <label key={plan} className="flex items-center space-x-3 cursor-pointer">
              <input
                type="checkbox"
                checked={(data.paymentPlans || []).includes(plan)}
                onChange={(e) => handleCheckboxChange('paymentPlans', plan, e.target.checked)}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700 text-sm">{plan}</span>
            </label>
          ))}
        </div>
      </div>

      {/* App Pricing */}
      <div className="bg-white p-6 rounded-lg border">
        <h3 className="text-lg font-semibold mb-4">App Pricing</h3>
        <p className="text-gray-600 mb-4">Configure your app's pricing structure and tiers:</p>

        {/* Pricing Models */}
        <div className="mb-6">
          <h4 className="text-md font-medium text-gray-800 mb-3">Pricing Model (Select One)</h4>
          <div className="space-y-4">
            <label className="flex items-center space-x-3 cursor-pointer">
              <input
                type="radio"
                name="pricingModel"
                checked={(data.pricingOptions || []).includes('Let the AI decide these for me')}
                onChange={(e) => {
                  if (e.target.checked) {
                    updateFormData('ecommercePayments', { pricingOptions: ['Let the AI decide these for me'] });
                  }
                }}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700 font-medium">Let the AI decide these for me</span>
            </label>
            {pricingModels.map((model) => (
              <div key={model.name} className="border border-gray-200 rounded-lg p-4">
                <label className="flex items-start space-x-3 cursor-pointer">
                  <input
                    type="radio"
                    name="pricingModel"
                    checked={(data.pricingOptions || []).includes(model.name)}
                    onChange={(e) => {
                      if (e.target.checked) {
                        updateFormData('ecommercePayments', { pricingOptions: [model.name] });
                      }
                    }}
                    className="rounded border-gray-300 text-blue-600 focus:ring-blue-500 mt-1"
                  />
                  <div className="flex-1">
                    <div className="font-medium text-gray-800">{model.name}</div>
                    <div className="text-sm text-gray-600 mb-2">{model.description}</div>
                    <div className="flex flex-wrap gap-2">
                      {model.levels.map((level) => (
                        <span key={level} className="px-2 py-1 bg-blue-100 text-blue-800 text-xs rounded">
                          {level}
                        </span>
                      ))}
                    </div>
                  </div>
                </label>
              </div>
            ))}
          </div>
        </div>

        {/* Number of Pricing Levels */}
        <div className="mb-6">
          <h4 className="text-md font-medium text-gray-800 mb-3">Number of Pricing Levels</h4>
          <div className="grid grid-cols-2 md:grid-cols-4 gap-3">
            {[1, 2, 3, 4].map((num) => (
              <label key={num} className="flex items-center space-x-3 cursor-pointer">
                <input
                  type="radio"
                  name="pricingLevels"
                  checked={(data.pricingLevels || []).length === num}
                  onChange={(e) => {
                    if (e.target.checked) {
                      // Keep the current level names but limit to the selected number
                      const currentLevels = data.pricingLevels || [];
                      const limitedLevels = currentLevels.slice(0, num);
                      updateFormData('ecommercePayments', { pricingLevels: limitedLevels });
                    }
                  }}
                  className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
                />
                <span className="text-gray-700 font-medium">{num} Level{num > 1 ? 's' : ''}</span>
              </label>
            ))}
          </div>
        </div>

        {/* Pricing Level Names */}
        <div className="mb-6">
          <h4 className="text-md font-medium text-gray-800 mb-3">Pricing Level Names (Select up to 4)</h4>
          <div className="space-y-4">
            <label className="flex items-center space-x-3 cursor-pointer">
              <input
                type="checkbox"
                checked={(data.pricingLevels || []).includes('Let the AI decide these for me')}
                onChange={(e) => handleCheckboxChange('pricingLevels', 'Let the AI decide these for me', e.target.checked)}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700 font-medium">Let the AI decide these for me</span>
            </label>

            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
              <div>
                <h5 className="text-sm font-medium text-gray-700 mb-2">Low Tier Names</h5>
                <div className="space-y-2">
                  {pricingLevelNames.low.map((level) => (
                    <label key={level} className="flex items-center space-x-3 cursor-pointer">
                      <input
                        type="checkbox"
                        checked={(data.pricingLevels || []).includes(level)}
                        onChange={(e) => handleCheckboxChange('pricingLevels', level, e.target.checked)}
                        className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
                      />
                      <span className="text-gray-700 text-sm">{level}</span>
                    </label>
                  ))}
                </div>
              </div>

              <div>
                <h5 className="text-sm font-medium text-gray-700 mb-2">Mid Tier Names</h5>
                <div className="space-y-2">
                  {pricingLevelNames.mid.map((level) => (
                    <label key={level} className="flex items-center space-x-3 cursor-pointer">
                      <input
                        type="checkbox"
                        checked={(data.pricingLevels || []).includes(level)}
                        onChange={(e) => handleCheckboxChange('pricingLevels', level, e.target.checked)}
                        className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
                      />
                      <span className="text-gray-700 text-sm">{level}</span>
                    </label>
                  ))}
                </div>
              </div>

              <div>
                <h5 className="text-sm font-medium text-gray-700 mb-2">High Tier Names</h5>
                <div className="space-y-2">
                  {pricingLevelNames.high.map((level) => (
                    <label key={level} className="flex items-center space-x-3 cursor-pointer">
                      <input
                        type="checkbox"
                        checked={(data.pricingLevels || []).includes(level)}
                        onChange={(e) => handleCheckboxChange('pricingLevels', level, e.target.checked)}
                        className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
                      />
                      <span className="text-gray-700 text-sm">{level}</span>
                    </label>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Yearly Discount */}
        <div className="mb-6">
          <h4 className="text-md font-medium text-gray-800 mb-3">Yearly Purchase Discount</h4>
          <div className="grid grid-cols-2 md:grid-cols-4 gap-3">
            <label className="flex items-center space-x-3 cursor-pointer">
              <input
                type="checkbox"
                checked={(data.yearlyDiscounts || []).includes('Let the AI decide these for me')}
                onChange={(e) => handleCheckboxChange('yearlyDiscounts', 'Let the AI decide these for me', e.target.checked)}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700 font-medium">Let the AI decide these for me</span>
            </label>
            {yearlyDiscounts.map((discount) => (
              <label key={discount} className="flex items-center space-x-3 cursor-pointer">
                <input
                  type="checkbox"
                  checked={(data.yearlyDiscounts || []).includes(discount)}
                  onChange={(e) => handleCheckboxChange('yearlyDiscounts', discount, e.target.checked)}
                  className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
                />
                <span className="text-gray-700 text-sm">{discount}</span>
              </label>
            ))}
          </div>
        </div>

        {/* Default Selections */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Default Pricing Model
            </label>
            <select
              value={data.defaultPricingOption || ''}
              onChange={(e) => handleInputChange('defaultPricingOption', e.target.value)}
              className="w-full p-3 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500 text-sm"
            >
              <option value="">Select default pricing model</option>
              {pricingModels.map((model) => (
                <option key={model.name} value={model.name}>{model.name}</option>
              ))}
              <option value="NO PREFERENCE - all are ok">NO PREFERENCE - all are ok</option>
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Default Pricing Level
            </label>
            <select
              value={data.defaultPricingLevel || ''}
              onChange={(e) => handleInputChange('defaultPricingLevel', e.target.value)}
              className="w-full p-3 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500 text-sm"
            >
              <option value="">Select default pricing level</option>
              {pricingLevelNames.low.map((level) => (
                <option key={level} value={level}>{level}</option>
              ))}
              {pricingLevelNames.mid.map((level) => (
                <option key={level} value={level}>{level}</option>
              ))}
              {pricingLevelNames.high.map((level) => (
                <option key={level} value={level}>{level}</option>
              ))}
              <option value="NO PREFERENCE - all are ok">NO PREFERENCE - all are ok</option>
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Default Yearly Discount
            </label>
            <select
              value={data.defaultYearlyDiscount || ''}
              onChange={(e) => handleInputChange('defaultYearlyDiscount', e.target.value)}
              className="w-full p-3 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500 text-sm"
            >
              <option value="">Select default yearly discount</option>
              {yearlyDiscounts.map((discount) => (
                <option key={discount} value={discount}>{discount}</option>
              ))}
              <option value="NO PREFERENCE - all are ok">NO PREFERENCE - all are ok</option>
            </select>
          </div>
        </div>
      </div>

      {/* Accounting Platforms */}
      <div className="bg-white p-6 rounded-lg border">
        <h3 className="text-lg font-semibold mb-4">Accounting Platforms</h3>
        <p className="text-gray-600 mb-4">Select all accounting platforms you want to integrate:</p>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-3">
          <label className="flex items-center space-x-3 cursor-pointer">
            <input
              type="checkbox"
              checked={(data.accountingPlatforms || []).includes('Let the AI decide these for me')}
              onChange={(e) => handleCheckboxChange('accountingPlatforms', 'Let the AI decide these for me', e.target.checked)}
              className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
            />
            <span className="text-gray-700 font-medium">Let the AI decide these for me</span>
          </label>
          <label className="flex items-center space-x-3 cursor-pointer">
            <input
              type="checkbox"
              checked={(data.accountingPlatforms || []).length === accountingPlatforms.length}
              onChange={(e) => {
                if (e.target.checked) {
                  updateFormData('ecommercePayments', { accountingPlatforms: [...accountingPlatforms] });
                } else {
                  updateFormData('ecommercePayments', { accountingPlatforms: [] });
                }
              }}
              className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
            />
            <span className="text-gray-700 font-medium">All are OK</span>
          </label>
          {accountingPlatforms.map((platform) => (
            <label key={platform} className="flex items-center space-x-3 cursor-pointer">
              <input
                type="checkbox"
                checked={(data.accountingPlatforms || []).includes(platform)}
                onChange={(e) => handleCheckboxChange('accountingPlatforms', platform, e.target.checked)}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
              />
              <span className="text-gray-700 text-sm">{platform}</span>
            </label>
          ))}
        </div>
        <div className="mt-6">
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Default Accounting Platform
          </label>
          <select
            value={data.defaultAccountingPlatform || ''}
            onChange={(e) => handleInputChange('defaultAccountingPlatform', e.target.value)}
            className="w-full p-3 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500 text-sm"
          >
            <option value="">Select default accounting platform</option>
            {accountingPlatforms.map((platform) => (
              <option key={platform} value={platform}>{platform}</option>
            ))}
            <option value="NO PREFERENCE - all are ok">NO PREFERENCE - all are ok</option>
          </select>
        </div>
      </div>
